import './Education.css';
import data from './data.json'

function Education() {
  return (
    <div className="Education">
      <h1>> education</h1>
      <div>
        <div>{data.education}</div>
        {data.map((edu) => (
          <div className="education-item">
            <h2>{edu.institution}</h2>
            <h2>{edu.degree}</h2>
            <h2>{edu.startdate}-{edu.enddate}</h2>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Education;
